import { Outlet, Link } from "react-router-dom";

const Layout = () => {
    return  (
        <>
            <nav>
                <ul>
                    <li>
                        <Link to="/">Disclaimer</Link>
                    </li>
                    <li>
                        <Link to="../Components/pages/Developer">Developer?</Link>
                    </li>
                    <li>
                        <Link to="../Components/pages/Faq">Customer Service</Link>
                    </li>
                </ul>
            </nav>

            <Outlet />
        </>
    )
};

export default Layout;
